import React  from 'react'

export const Post = (props) => {

    const { imgUrl, style, lensBrand, caption, camera } = props

    return (
        <div className="posts">

                <img src={imgUrl} alt="post img" width="200" height="150"></img>
            <h1>{caption}</h1>
            <br></br>
                <p>
                    Camera: {camera} 
                </p>
                <p>
                    Lens: {lensBrand}
                </p>
                <p>
                Photography Style: {style}
                </p>
        </div>
    )
}
